import { React } from "react";
import styled from "styled-components";
import hassan2 from "../img/hassan2.JPG";
import hassan3 from "../img/hassan5.JPG";
import hassan4 from "../img/hassan4.JPG";
import hassan from "../img/32842 (1).jpg";
import { motion } from "framer-motion";
import { pageAnimation } from "../animation";
import ScrollTop from "./../Components/ScrollTop";

const OurWork = () => {
  return (
    <Work
      style={{ background: "#f5f7fa" }}
      exit="exit"
      variants={pageAnimation}
      initial="hidden"
      animate="show"
    >
      <Title>Information Technology Army Officer</Title>
      <Subtitle>
        Egyptian Armed Forces | The Main Armor 101 Workshop <br />
        <small>Hikestep, Cairo, Egypt (April 2022 - October 2023)</small>
      </Subtitle>

      <ContentGrid>
        <GridItem>
          <Point>
            🟢 Led a Team of 3-4 Soldiers and 1-2 Non-Commissioned Officers in
            the IT Department, Overseeing the Development and Maintenance of an
            Internal Private Website as a <Highlight>Full Stack Developer</Highlight>.
          </Point>
          <StyledImage src={hassan} alt="Army Officer" />
        </GridItem>

        <GridItem reverse>
          <StyledImage src={hassan3} alt="Project Image" />
          <Point>
            🟢 Managed the <Highlight>Server Manager of a LAN network and Clients</Highlight>, 
            providing Technical Support and Troubleshooting issues with Hardware and Software.
          </Point>
        </GridItem>

        <GridItem>
          <Point>
            🟢 Responsible for the Installation, Configuration, and Maintenance
            of Server Infrastructure, Including <Highlight>Active Directory</Highlight> Services, 
            Managing <Highlight>User Accounts</Highlight>, <Highlight>Security Permissions</Highlight>, 
            <Highlight>Group Policies</Highlight>, and other Network-Related Tasks as a 
            <Highlight>Network Administrator</Highlight>.
          </Point>
          <StyledImage src={hassan4} alt="Network Admin Work" />
        </GridItem>

        <GridItem reverse>
          <StyledImage src={hassan2} alt="SQL Technical Support" />
          <Point>
            🟢 Successfully Solved Complex Database Query Problems as 
            <Highlight>Technical Application Support</Highlight> in Server Manager 
            <Highlight>SQL</Highlight>.
          </Point>
        </GridItem>

        <GridItem>
          <Point>
            🟢 Implemented an Auto <Highlight>Backup</Highlight> for <Highlight>Database</Highlight> 
            and for the Network, ensuring Regular Backups of Critical data and Establishing 
            Procedures for System Failures or Data Loss.
          </Point>
          <StyledImage src={hassan} alt="Backup System" />
        </GridItem>
      </ContentGrid>
      <ScrollTop />
    </Work>
  );
};

// Styled Components
const Work = styled(motion.div)`
  min-height: 100vh;
  padding: 5rem 10rem;
  background: #f5f7fa;
  @media (min-width: 1024px) {
    padding: 6rem 12rem;
  }
`;

const Title = styled(motion.h2)`
  font-size: 3.5rem;
  text-align: center;
  color: #333;
  margin-bottom: 1.5rem;
`;

const Subtitle = styled(motion.h3)`
  text-align: center;
  font-size: 1.7rem;
  color: #666;
  margin-bottom: 3.5rem;
`;

const ContentGrid = styled.div`
  display: grid;
  gap: 2.5rem;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const GridItem = styled.div`
  display: flex;
  align-items: center;
  gap: 2.5rem;
  flex-direction: ${(props) => (props.reverse ? "row-reverse" : "row")};

  @media (max-width: 768px) {
    flex-direction: column;
  }
`;

const Point = styled.div`
  font-size: 1.3rem;
  color: #333;
  padding: 1.5rem;
  background: #fff;
  border-left: 5px solid #23d997;
  border-radius: 8px;
  box-shadow: 0 4px 10px rgba(0, 0, 0, 0.1);
`;

const Highlight = styled.span`
  font-weight: bold;
  color: #23d997;
`;

const StyledImage = styled.img`
  width: 100%;
  max-width: 400px;
  border-radius: 10px;
  box-shadow: 0 4px 10px rgba(0, 0, 0, 0.15);
  transition: transform 0.3s ease;
  &:hover {
    transform: scale(1.05);
  }
`;

export default OurWork;
